raron llave de paso. Es una bomba de tiempo. Adm. Maria Eraso 3415666959 Porp. orlando 07-03 Tel: 3415037423','2023-06-01 15:17:30','2023-06-01 15:18:42','2023-06-01 15:20:46'),(8,9,'Abierto','[]','Filtracion en lavadero desde el departamento de arriba que esta desocupado, no se sabe si se arreglo o cerraron llave de paso. Es una bomba de tiempo. Adm. Maria Eraso 3415666959 Porp. orlando 07-04 Tel: 3415037423','2023-06-01 15:20:34','2023-06-01 15:20:34',NULL),(9,50,'Abierto','[{\"comment\":\"Se solicita: \\n- opinión de Horacio y presupuestos \\n- Presupuesto a Eki aberturas que ya realizo cambios en el edificio 3415 48-9563 \\n- Presupuesto a Moderna aberturas 3518 73-1411 \\n- Presupuesto a Mega Aberturas 3413 12-9332\\n- Presupuesto a Torri aberturas 3415 55-1589\",\"date\":\"2023-07-03T14:30:52.393Z\"}]','solicitar presupuestos por abeturas ventanas detonadas en ambos dormitorios y living','2023-06-01 18:02:34','2023-07-03 14:31:15',NULL),(10,21,'Cerrado','[]','COCINA!','2023-06-01 18:03:52','2023-07-03 13:25:42',NULL),(11,2,'Abierto','[]','Revisión aire acondicionado por estar pinchado, el verano pasado el inq. realizo carga pero sigue la perdida','2023-06-01 18:06:16','2023-06-01 18:06:16',NULL),(12,52,'Abierto','[]','piso parquet frente cocina y sector ante baño despegado,  se manda Horacio. pasa presupuesto','2023-11-06 16:55:28','2023-11-06 16:55:28',NULL);
